// components
import Navbar from './components/Navbar';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter> 
      <Navbar />
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
